(ns advent-2018.day-5
  (:require [clojure.string :as str]
            [criterium.core :as crit]))

(def data "")
(def toy-data "dabAcCaCBAcCcaDA")

(defn react [data]
  (let [opposite? (fn [a b]
                    (if (or (nil? a)
                            (nil? b))
                      false
                      (= (Math/abs (- (int a)
                                      (int b)))
                         32)))]
    (->> data
         (reduce (fn [polymer c]
                   (if
                     (opposite? (peek polymer) c)
                     (pop polymer)
                     (conj polymer c)))
                 '()))))

(defn part-1 [data]
  (count (react data)))

(defn part-2 [data]
  (let [reacted (apply str (react data))
        generate-regex (fn [c]
                         (read-string (apply str
                                             "#\"["
                                             c
                                             (str/upper-case c)
                                             "]\"")))]
    (->> (range (int \a)
                (int \z))
         (pmap char)
         (pmap #(str/replace reacted (generate-regex %) ""))
         (pmap react)
         (pmap count)
         (apply min))))

(comment
  (part-1 data)
  (part-2 data))

(crit/quick-bench (part-1 data))
(crit/quick-bench (part-2 data))